ng: 0 1.5em 1.5em 0;\n  }\n  \n  .account .settings .pi td {\n    padding: 2px 2px 2px 7px;\n  }\n  \n  .account .settings table td.headings {\n    font-weight: bold;\n    width: auto;\n  }\n  \n  .account .settings ul {\n    width: 100%;\n    list-style: none outside;\n    margin: 0;\n    padding: 0;\n  }\n  \n  .account .settings ul li span.light {\n    color: #6f6f6f\n  }\n\n  .account .settings ul li span.errormsg {\n    color: red;\n  }\n  \n  .products {\n    list-style: none outside;\n    padding: 0 0 1em;\n    margin: 0;\n  }\n  \n  .products li {\n    float: left;\n    width: 32.999%;\n    display: inline;\n    height: 35px;\n    margin: 0;\n    padding: 0;\n    font-weight: bold;\n  }\n  \n  .products li span {\n    display: block;\n    margin: 0;\n    margin-left: 30px;\n  }\n  \n  .products li img {\n    float: left;\n  }\n  \n  .products li a.light {\n    font-weight: normal;\n    color: #77c;\n  }\n  \n  .products li.more {\n    clear: both;\n    padding: .2em 0 0;\n    font-weight: normal;\n  }\n\n  \n  \n\n\
